        private static AutoFuncDelegate[,,] func_T3 = Func_T3_Providers();

        // Methods
        public static object AutoAnyInteropDelegateFromParameters(object instance, MethodBase target)
        {
            if(target is MethodInfo && ((MethodInfo)target).ReturnType != typeof(void))
            {
                // Create func delegate
                return AutoFuncInteropDelegateFromParameters(instance, target);
            }

            // Create action delegate
            return AutoActionInteropDelegateFromParameters(instance, target);
        }

        public static object AutoActionInteropDelegateFromParameters(object instance, MethodBase target)
        {
            // Important - this method does slow lookup for a suitable AOT delegate that can be used for interop calls
            // For the moment there is no other way and unfortunately it will not support passing reference types explicitly for interop calls. 
            // Instead you must use 'System.object' in those cases and cast at the receivng end. 

            // Get parameters
            ParameterInfo[] parameters = target.GetParameters();

            // Parameterless 
            if (parameters.Length == 0)
            {
                // Create parameterless delegate
                return AutoActionInteropDelegate(instance, target);
            }
            else
            {
                AutoActionDelegate targetDelegate = null;

                switch(parameters.Length)
                {
                    case 1:
                        {
                            TypeCode code = Type.GetTypeCode(parameters[0].ParameterType);
                            targetDelegate = action_T1[(int)Type.GetTypeCode(parameters[0].ParameterType)];
                            break;
                        }
                    case 2:
                        {
                            targetDelegate = action_T2[(int)Type.GetTypeCode(parameters[0].ParameterType), (int)Type.GetTypeCode(parameters[1].ParameterType)];
                            break;
                        }
                    case 3:
                        {
                            targetDelegate = action_T3[(int)Type.GetTypeCode(parameters[0].ParameterType), (int)Type.GetTypeCode(parameters[1].ParameterType), (int)Type.GetTypeCode(parameters[2].ParameterType)];
                            break;
                        }
                    default: throw new NotSupportedException("A suitable AOT delegate could not be constructed for the given parameters. Parameter list is restricted to max 3 args");
                }

                // Construct final delegate
                if (targetDelegate != null)
                    return targetDelegate(instance, target);

                throw new NotSupportedException("A suitable AOT delegate could not be constructed for the given parameters. Please replace reference type parameters with System.object to ensure compatibility with interop calls");
            }
        }

        public static object AutoFuncInteropDelegateFromParameters(object instance, MethodBase target)
        {
            // Important - this method does slow lookup for a suitable AOT delegate that can be used for interop calls
            // For the moment there is no other way and unfortunately it will not support passing reference types explicitly for interop calls. 
            // Instead you must use 'System.object' in those cases and cast at the receivng end. 

            // Get return
            Type returnType = ((MethodInfo)target).ReturnType;

            // Get parameters
            ParameterInfo[] parameters = target.GetParameters();

            // Parameterless 
            AutoFuncDelegate targetDelegate = null;

            switch (parameters.Length)
            {
                case 0:
                    {
                        targetDelegate = func_T1[(int)Type.GetTypeCode(returnType)];
                        break;
                    }
                case 1:
                    {
                        targetDelegate = func_T2[(int)Type.GetTypeCode(parameters[0].ParameterType), (int)Type.GetTypeCode(returnType)];
                        break;
                    }
                case 2:
                    {
                        targetDelegate = func_T3[(int)Type.GetTypeCode(parameters[0].ParameterType), (int)Type.GetTypeCode(parameters[1].ParameterType), (int)Type.GetTypeCode(returnType)];
                        break;
                    }
            }

            // Construct final delegate
            if (targetDelegate != null)
                return targetDelegate(instance, target);

            throw new NotSupportedException("A suitable AOT delegate could not be constructed for the given parameters. Please replace reference type parameters with System.object to ensure compatibility with interop calls");            
        }

        #region Action
        public static object AutoActionInteropDelegate(object instance, MethodBase target)
        {
            return ActionInteropDelegate(instance, target);
        }

        public static Action ActionInteropDelegate(object instance, MethodBase target)
        {
            return () =>
            {
                // Invoke target method
                target.Invoke(instance, null);
            };
        }
        #endregion

        #region Action(T)
        public static object AutoActionInteropDelegate<T>(object instance, MethodBase target)
        {
            Type t = typeof(T);
            object val = ActionInteropDelegate<T>(instance, target);

            return val;
        }

        public static Action<T> ActionInteropDelegate<T>(object instance, MethodBase target)
        {
            return (T val) =>
            {
                // Invoke target method
                target.Invoke(instance, new object[] { val });
            };
        }

